import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Calendar from './index';
import AlertDismissibleExample from '../small-componets/alert/alert'


function showCalendar({showCalendar, form, value, setValue, back, booked, AlertShow}) {
    
    let calendar = null
    if (showCalendar){
        calendar = (
        <Container>
            <Row>Pick a Day</Row>
            <Row>
              <Col><p className='kayaks-0'>kayaks = 0</p></Col>
              <Col><p className='kayaks-2'>kayaks > 2</p></Col>
              <Col><p className='kayaks-4'>kayaks > 4</p></Col>
              <Col><p className='kayaks-6'>kayaks > 6</p></Col>
              <Col><p className='kayaks-8'>kayaks > 8</p></Col>
            </Row>
            <Calendar form={form} back={back} value={value} onChange={setValue} booked={booked} />
        </Container>)
    } else { calendar = null };
    
    let alert = null
    if (AlertShow){
        alert = (<AlertDismissibleExample show={showWhichAlert} />)
    } else {alert = null}
    
    return (
        <div>
            {alert}
            {calendar}
        </div>
    )
}

export default showCalendar;
